INSERT INTO `news` VALUES (1,'Мы открылись!','Дорогие Друзья.\r\nМы рады поздравить вас с открытием сайта!\r\nЭтот долгожданный момент настал, мы прошли через много трудностей и преград но мы сделали это.\r\nБлагодарим вас за Вашу поддержку и терпение. Наш сайт уже полностью работает но еще в тестовом режиме, мы будем развивать и совершенствовать наш проект для процветания нашего с вами дела.\r\nУспехов и богатства дорогие партнёры!','2019-01-27 12:40:08'),(2,'Информационный Сайт','Дорогие друзья! \r\nУ нас есть информационный сайт, вы можете его использовать для просмотра расписания брифингов, роликов от компании а так же можете его использовать для ваших презентаций.\r\nСсылка на информационный сайт http://lcglservice.com\r\nВсем Успехов.\r\n','2019-01-30 20:47:48'),(3,'Лендинг','Уважаемые партнёры!\r\nНашей компанией была разработана Лендинг страница для вас, на странице размещена информация о проекте с вашими контактными данными.\r\nСтраница сделана профессионально, это ваша визитная карточка для работы в интернете!\r\nПревью лендинг страницы http://lcglservice.com/preview/\r\nВы можете заказать себе лендинг по форме тех поддержки выбрав тему обращения \"заказ лендинга\".\r\nДля лендинга будут нужны следующие данные Ваши: Skype; Telegram; WhatsApp или Viber; Facebook; VK; Instagram и ваше фото.\r\nЭта услуга идёт в подарок нашим партнёрам!','2019-03-12 17:34:05'),(4,'Технические работы','Уважаемые партнёры, на сайте проводятся технические работы по созданию новых площадок, сайт работает но могут быть некоторые сбои, не переживайте, всё восстановится!\r\nС Уважением команда LC GreenLife!','2019-06-26 00:40:28');
